            class FSM {
                constructor () {
                    this.states = {};
                    this.currentState = 'default';
                }
                moveToState(state) {
                    if (!this.states[state] || this.currentState === state) {
                        return false;
                    } else {
                        if (this.states[state]._before) {
                            this.states[state]._before();
                        }
                        this.currentState = state;
                        if (this.states[state]._after) {
                            this.states[state]._after();
                        }
                        return true;
                    }
                }
                runAction(action, ...args) {
                    if (!this.states[this.currentState][action]) {
                        return false;
                    } else {
                        this.states[this.currentState][action](...args);
                        return true;
                    }
                }
                _populateTestStates () {
                    this.states = {
                        'test': {
                            '_before': () => {console.log('before');},
                            '_after': () => {console.log('after');},
                            'special action': (a, c) => {console.log('SPECIAL', [a, c]);}
                        }
                    };

                    */
                }
            }
            var wasm
            var output_string_buffers = []
            var output_array_buffers = []
            function read_last_string_buffer(offset = 1) {
                return output_string_buffers[output_string_buffers.length - offset]
            }
            function read_last_array_buffer(offset = 1) {
                return output_array_buffers[output_array_buffers.length - offset]
            }
            var importObject = {
                env: {
                    memory: new WebAssembly.Memory({
                        initial: 512,     // 200 pages = ~12.8MB
                        maximum: 2048     // 1000 pages = ~64MB
                    }),
                    js_console_log: function(ptr, len) {
                        var bytes = new Uint8Array(wasm.exports.memory.buffer, ptr, len)
                        var message = new TextDecoder('utf-8').decode(bytes)
                        console.log(message)
                    },
                    js_output_string_buffer: function(ptr, len) {
                        var bytes = new Uint8Array(wasm.exports.memory.buffer, ptr, len)
                        var message = new TextDecoder('utf-8').decode(bytes)
                        // console.log(message)
                        output_string_buffers.push(message)
                        MAX_STRING_BUFFER_ENTRIES = 200
                        if (output_string_buffers.length > MAX_STRING_BUFFER_ENTRIES) {
                            output_string_buffers.shift()
                        }
                    },
                    js_output_array_buffer: function(ptr, len) {
                        var array = new Int32Array(wasm.exports.memory.buffer, ptr, len)
                        // console.log(array)
                        output_array_buffers.push(array)
                        MAX_STRING_ARRAY_ENTRIES = 200
                        if (output_array_buffers.length > MAX_STRING_ARRAY_ENTRIES) {
                            output_array_buffers.shift()
                        }
                    },
                }
            }

            function formatMemorySize(bytes) {
                const kb = bytes / 1024;
                const mb = kb / 1024;
                const gb = mb / 1024;
                
                if (gb >= 1) return `${gb.toFixed(2)} GB`;
                if (mb >= 1) return `${mb.toFixed(2)} MB`;
                if (kb >= 1) return `${kb.toFixed(2)} KB`;
                return `${bytes} Bytes`;
            }

            function wasm_setInputString(str) {
                var encoder = new TextEncoder();
                var bytes = encoder.encode(str);

                var ptr = wasm.exports.get_input_string_buffer_ptr();
                var maxSize = wasm.exports.get_input_string_buffer_len();
                
                if (bytes.length > maxSize) {
                    throw new Error("String too large for buffer");
                }

                new Uint8Array(wasm.exports.memory.buffer).set(bytes, ptr);

                wasm.exports.set_input_string_buffer_length(str.length)
            }
            function wasm_setInputArray(array) {
                var ptr = wasm.exports.get_input_array_buffer_ptr();
                var maxSize = wasm.exports.get_input_array_buffer_len();
                
                if (array.length > maxSize) {
                    throw new Error("Array too large for buffer");
                }

                new Int32Array(wasm.exports.memory.buffer, ptr, array.length).set(array);
            }
            function readStringFromWasm(start, length) {
                // console.trace({start, length})
                var string_buffer = new Uint8Array(
                    wasm.exports.memory.buffer,
                    start,
                    length,
                )
                var string = new TextDecoder('utf-8').decode(string_buffer)
                // console.log("String from WASM:", string)
                return string
            }
            function readDbStringFromWasm(id, machine_name = false) {
                var start, length
                if (machine_name) {
                    start = wasm.exports.get_string_machine_name_ptr(id)
                    length = wasm.exports.get_string_machine_name_len(id)
                } else {
                    start = wasm.exports.get_string_text_ptr(id)
                    length = wasm.exports.get_string_text_len(id)
                }
                return readStringFromWasm(start, length)
            }

                    let value = cardNumber % 13;
                    
                    // Adjust for 0 to be 13 (King)
                    if (value === 0) value = 13;
                    
                    // Convert to visual representation
                    switch (value) {
                        case 11: return 'J';
                        case 12: return 'Q';
                        case 13: return 'K';
                        case 1: return 'A';
                        default: return value.toString();

                            document.getElementById('blackjack_dealer_hand').appendChild(card)
                        }
                    }
                    var player_total = wasm.exports.blackjack_get_players_deck_value()
                    var dealer_total = wasm.exports.blackjack_get_dealers_deck_value()
                    document.getElementById('blackjack_player_total').innerHTML = 'Player: ' + player_total
                    document.getElementById('blackjack_dealer_total').innerHTML = 'Dealer: ' + dealer_total
                },
                removeCardsFromBlackjackTable: function () {
                    // TODO: Handle these element references properly
                    document.getElementById('blackjack_player_total').innerHTML = 0
                    document.getElementById('blackjack_dealer_total').innerHTML = 0
                    var cards = document.querySelectorAll('#blackjack_table #blackjack_player_hand div')
                    for (var c = 0; c < cards.length; ++c) {
                        if (cards[c] instanceof HTMLElement) {
                            cards[c].remove()
                        }
                    }
                    var cards = document.querySelectorAll('#blackjack_table #blackjack_dealer_hand div')
                    for (var c = 0; c < cards.length; ++c) {
                        if (cards[c] instanceof HTMLElement) {
                            cards[c].remove()
                        }
                    }
                },
            }

            // var rotateX = 67
            var RAF = {
                fps: 60,
                interval: 1000,
                last_time: 0,
                is_paused: false,
                last_log_time: 0,
                log_interval: 0,
                fps_value: 0,
                last_fps_time: 0,
                frame_count: 0,
                initialize: function () {
                    RAF.interval = RAF.interval / RAF.fps
                },
                animate: function(current_time) {
                    requestAnimationFrame(RAF.animate)

                    if (!RAF.is_paused) {
                        // Calculate time elapsed since last frame
                        var delta_time = current_time - RAF.last_time

                        // Only update if enough time has passed
                        if (delta_time >= RAF.interval) {
                            // Update last time, accounting for any extra time
                            RAF.last_time = current_time - (delta_time % RAF.interval)

                            RAF.update(delta_time, current_time)
                            RAF.render()

                            ++RAF.frame_count
                        }
                    }

                    // Calculate FPS every second
                    if (current_time - RAF.last_fps_time >= 1000) {
                        RAF.fps_value = Math.round((RAF.frame_count * 1000) / (current_time - RAF.last_fps_time))
                        RAF.frame_count = 0
                        RAF.last_fps_time = current_time
                    }
                },
                update: function(delta_time, current_time) {
                    if (current_time - RAF.last_log_time >= RAF.log_interval) {
                        RAF.last_log_time = current_time
                    }
                },
                can_tick: true,
                render: function () {
                    if (wasm) {
                        // console.log("Current memory:", formatMemorySize(wasm.exports.memory.buffer.byteLength))
                        // document.body.setAttribute('style', 'transform-style: preserve-3d; perspective: 1000px')
                        // document.querySelector('#viewport').style.transform = 'rotateX(' + rotateX + 'deg)'
                        // document.querySelector('#viewport div[viewport_x="0"][viewport_y="0"]').style.transform = 'rotateY(80deg)'
                        game_mode = gh.getGameMode()
                        uih.hidePlayerMenu()
                        if (game_mode === "In Player Menu") {
                            uih.showPlayerMenu()
                        } else if (game_mode === "In Scene" && gh.shouldRedraw()) {
                            scene_name = gh.getCurrentSceneName()
                            scene_state_name = gh.getCurrentSceneStateName()
                            console.log({scene_name, scene_state_name})
                            if (scene_name === "scene_blackjack") {
                                uih.showSceneTextWrapper()
                                if (gh.getCurrentSceneHasDialogue()) {
                                    uih.showSceneDialogue(gh.getCurrentSceneDialogue())
                                }

                                uih.clearSceneChoices()
                                clear_scene_inputs()
                                if (gh.getCurrentSceneChoicesCount() > 0) {
                                    var total_choices = gh.getCurrentSceneChoicesCount()
                                    scene_total_choices += total_choices
                                    for (var t = 0; t < scene_total_choices; ++t) {
                                        if (!gh.getCurrentSceneChoiceEnabled(t)) { continue; }
                                        var choice = gh.getCurrentSceneChoiceText(t)
                                        var machine_name = gh.getCurrentSceneChoiceMachineName(t)
                                        var choice_el
                                        if (machine_name === "number_input") {
                                            choice_el = document.createElement('div')
                                            choice_el.classList.add('scene_choice')
                                            choice_el.innerHTML = gh.getCurrentSceneInputNumber()
                                            choice_el.id = t
                                        } else {
                                            choice_el = document.createElement('div')
                                            choice_el.classList.add('scene_choice')
                                            choice_el.innerHTML = choice
                                            choice_el.id = t
                                        }
                                        if (t === 0) {
                                            choice_el.classList.add('current')
                                        }
                                        uih.el.scene_text_wrapper.choices.appendChild(choice_el)
                                    }
                                    uih.showSceneChoices()
                                }

                                if (gh.getCurrentSceneNeedsNumericalInput()) {
                                    document.getElementById('scene_user_numerical_input').value = 0
                                    document.getElementById('scene_numerical_input').style.display = 'block'
                                } else {
                                    document.getElementById('scene_numerical_input').style.display = 'none'
                                }

                                if (
                                    scene_state_name == "blackjack_deal_deck" ||
                                    scene_state_name == "blackjack_player_turn" ||
                                    scene_state_name == "blackjack_dealer_turn" ||
                                    scene_state_name == "blackjack_check_winner" ||
                                    scene_state_name == "blackjack_deal_player_card" ||
                                    scene_state_name == "blackjack_deal_dealer_card"
                                ) {
                                    uih.showBlackjackTable()
                                    uih.updateCardsOnBlackjackTable()
                                } else {
                                    uih.hideBlackjackTable()
                                }
                            }
                        } else if (game_mode === "In Port") {
                            clear_scene_inputs()
                            uih.hideOpeningTitleScreen()
                            uih.hideSceneTextWrapper()
                            uih.hidePlayerMenu()
                            uih.hideBlackjackTable()
                            document.getElementById('viewport').style.display = 'grid'
                            document.getElementById('viewport').style.gridTemplateColumns = `repeat(${wasm.exports.get_viewport_width()}, 1fr)`
                            document.getElementById('viewport').style.gridTemplateRows = `repeat(${wasm.exports.get_viewport_height()}, 1fr)`

                            if (gh.shouldRedraw()) {
                                // console.log('Should redraw')
                                // TODO: This should become "render viewport" or whatever
                                for (var i = 0; i < wasm.exports.get_viewport_width(); ++i) {
                                    for (var j = 0; j < wasm.exports.get_viewport_height(); ++j) {
                                        var tile = document.getElementById('viewport').children[i + j * wasm.exports.get_viewport_width()]

                                        // One approach: get values for all layers, read through array buffer
                                        // var total_layers = wasm.exports.get_viewport_values_at_coordinates(i, j)
                                        // for (var t = 0; t < total_layers; ++t) {
                                        //     var layer_name = read_last_string_buffer(t + 1)
                                        //     if (layer_name === "npc_layer") {
                                        //         var npc_name = read_last_string_buffer(t + 2)
                                        //         // console.log(npc_name)
                                        //         var npc_iterator = read_last_array_buffer(t + 1)[0]
                                        //         var npc_direction = read_last_array_buffer(t + 2)[1]
                                        //         // console.log({npc_iterator, npc_direction})
                                        //         if (npc_iterator === 2) {
                                        //             tile.style.backgroundColor = 'blue'
                                        //         }
                                        //     } else if (layer_name === "bg_layer") {
                                        //         var layer_iterator = read_last_array_buffer(t + 1)[0]
                                        //         var layer_value = read_last_array_buffer(t + 1)[1]
                                        //         // console.log({layer_iterator, layer_value})
                                        //         if (layer_value === 1) {
                                        //             tile.style.backgroundColor = 'rgba(0, 0, 0, 0.8)'
                                        //         }
                                        //     }
                                        // }

                                        // Second approach: Just iterate through all layers and check the name
                                        // var total_layers = wasm.exports.get_current_world_total_layers()
                                        // // Note: You would think it has to be <, just <, but 0 is an empty layer as a placeholder so we have to go with <=
                                        // for (var t = 0; t <= total_layers; ++t) {
                                        //     wasm.exports.get_current_world_layer_name_by_id(t)
                                        //     if (read_last_string_buffer() === "npc_layer") {
                                        //         var layer_value = wasm.exports.get_viewport_value_at_coordinates(t, i, j)
                                        //         if (layer_value > 0) {
                                        //             tile.style.backgroundColor = 'blue'
                                        //         }
                                        //     } else if (read_last_string_buffer() === "bg_layer") {
                                        //         var layer_value = wasm.exports.get_viewport_value_at_coordinates(t, i, j)
                                        //         if (layer_value > 0) {
                                        //             tile.style.backgroundColor = 'rgba(0, 0, 0, 0.8)'
                                        //         }
                                        //     }
                                        // }

                                        // Third approach: Get specific layers you want to deal with up front
                                        var layer_id = gh.getCurrentLayerIDByString("bg_layer")
                                        if (layer_id !== wasm.exports.get_sentry()) {
                                            var layer_value = wasm.exports.get_viewport_value_at_coordinates(layer_id, i, j)
                                            if (layer_value !== wasm.exports.get_sentry()) {
                                                tile.style.backgroundColor = 'rgba(0, 0, 100, 0.8)'
                                            }
                                        }
                                        var layer_id = gh.getCurrentLayerIDByString("layer_one")
                                        if (layer_id !== wasm.exports.get_sentry()) {
                                            var layer_value = wasm.exports.get_viewport_value_at_coordinates(layer_id, i, j)
                                            if (layer_value !== wasm.exports.get_sentry()) {
                                                tile.style.backgroundColor = 'purple'
                                            }
                                        }
                                        var layer_id = gh.getCurrentLayerIDByString("npc_layer")
                                        if (layer_id !== wasm.exports.get_sentry()) {
                                            var layer_value = wasm.exports.get_viewport_value_at_coordinates(layer_id, i, j)
                                            if (layer_value !== wasm.exports.get_sentry()) {
                                                // TODO: One approach: Check the machine name of the player and see if it's a player
                                                tile.style.backgroundColor = 'green'
                                            }
                                        }
                                        var layer_id = gh.getCurrentLayerIDByString("block_layer")
                                        if (layer_id !== wasm.exports.get_sentry()) {
                                            var layer_value = wasm.exports.get_viewport_value_at_coordinates(layer_id, i, j)
                                            if (layer_value !== wasm.exports.get_sentry()) {
                                                tile.style.backgroundColor = 'yellow'
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    } else {
                        alert("NO WASM")
                    }
                    wasm.exports.tick()
                },
                togglePause: function () {
                    RAF.is_paused = !RAF.is_paused
                    console.log(RAF.is_paused ? 'RAF paused' : 'RAF resumed')
                }
            }

            var scene_choice_cursor = 0
            var scene_total_choices = 0
            function clear_scene_inputs() {
                scene_choice_cursor = 0
                scene_total_choices = 0
            }

            window.addEventListener('load', function () {
                RAF.initialize()

                var base64 = true
                if (base64) {
                    var bytes = Uint8Array.from(atob(wasmBase64), c => c.charCodeAt(0))
                    WebAssembly.instantiate(bytes, importObject).then(results => {
                        var instance = results.instance
                        wasm = instance

                        console.log("Starting memory:", formatMemorySize(wasm.exports.memory.buffer.byteLength))
                        console.log("Pages:", wasm.exports.memory.buffer.byteLength / 65536);

                        start_game()
                    })
                } else {
                    fetch('wasm_game.wasm')
                        .then(function(response) { return response.arrayBuffer() })
                        .then(function(bytes) { return WebAssembly.instantiate(bytes, importObject) })
                        .then(function(results) {
                            var instance = results.instance
                            wasm = instance

                            console.log("Starting memory:", formatMemorySize(wasm.exports.memory.buffer.byteLength))
                            console.log("Pages:", wasm.exports.memory.buffer.byteLength / 65536);

                            start_game()
                        })
                }

                // NOTE: Keeping this here because, in the future, we may want this
                // async function loadGameTextFromUrl(url) {
                //     const response = await fetch(url);
                //     const binaryData = await response.arrayBuffer();
                //     const uint8Array = new Uint8Array(binaryData);
                    
                //     return loadGameText(uint8Array);                }

                // // Usage example:
                // loadGameTextFromUrl('text_data.bin')
                //     .then(gameText => {
                //         console.log(gameText); // Your array of text strings
                //     })
                //     .catch(error => {
                //         console.error("Error loading game text:", error);
                //     });
            })

            var game_mode
            function start_game() {
                console.log('Starting game here')

                var TILE_SIZE = 16
                var TILE_SCALE = 2
                var TILE_SIZE_SCALED = TILE_SIZE * TILE_SCALE
                wasm.exports.set_viewport_size(12, 12)
                document.getElementById('viewport').style.width = (TILE_SIZE_SCALED * wasm.exports.get_viewport_width()) + 'px'
                document.getElementById('viewport').style.height = (TILE_SIZE_SCALED * wasm.exports.get_viewport_height()) + 'px'
                for (var i = 0; i < wasm.exports.get_viewport_width(); ++i) {
                    for (var j = 0; j < wasm.exports.get_viewport_height(); ++j) {
                        var tile = document.createElement('div')
                        tile.style.width = TILE_SIZE_SCALED + 'px'
                        tile.style.height = TILE_SIZE_SCALED + 'px'
                        tile.style.backgroundColor = 'purple'
                        tile.style.border = '1px solid white'
                        tile.setAttribute('viewport_x', i)
                        tile.setAttribute('viewport_y', j)
                        tile.setAttribute('world_x', i)
                        tile.setAttribute('world_y', j)
                        document.getElementById('viewport').appendChild(tile)
                    }
                }
                wasm.exports.initialize_game()
                console.log("Current memory:", formatMemorySize(wasm.exports.memory.buffer.byteLength))
                game_mode = gh.getGameMode()
                if (game_mode == "Empty") {
                    uih.initialize()
                    console.log('Game is empty, starting frames')
                    requestAnimationFrame(RAF.animate)
                }

                document.addEventListener('keyup', function (e) {
                    game_mode = gh.getGameMode()
                    switch (e.code) {
                        case "KeyZ":
                            wasm.exports.user_input_a()
                            if (game_mode === "In Scene") {
                                var current_scene_choice = document.querySelector('.scene_choice.current')
                                if (current_scene_choice instanceof HTMLElement) {
                                    if (gh.getCurrentSceneNeedsNumericalInput()) {
                                        var current_value = document.getElementById('scene_user_numerical_input').value
                                        console.log("CURRENT VALUE IS", current_value)
                                        wasm.exports.user_input_number(current_value)
                                    }
                                    wasm.exports.current_scene_make_choice(current_scene_choice.id)
                                } else {
                                    console.log("Tried to get an element that didn't exist")
                                }
                            }
                        break
                        case "KeyX":
                            wasm.exports.user_input_b()
                        break
                        case "KeyC":
                            wasm.exports.user_input_x()
                        break
                        case "KeyV":
                            wasm.exports.user_input_y()
                        break
                        case "KeyA":
                            wasm.exports.user_input_left()
                        break
                        case "KeyD":
                            wasm.exports.user_input_right()
                        break
                        case "KeyW":
                            wasm.exports.user_input_up()
                            if (game_mode === "In Scene") {
                                var current_scene_choices = document.querySelectorAll('.scene_choice')
                                for (var i = 0; i < current_scene_choices.length; ++i) {
                                    current_scene_choices[i].classList.remove('current')
                                }
                                if ((scene_choice_cursor - 1) < 0) {
                                    scene_choice_cursor = current_scene_choices.length - 1
                                } else {
                                    scene_choice_cursor -= 1
                                }
                                current_scene_choices[scene_choice_cursor].classList.add('current')
                            }
                        break
                        case "KeyS":
                            wasm.exports.user_input_down()
                            if (game_mode === "In Scene") {
                                var current_scene_choices = document.querySelectorAll('.scene_choice')
                                for (var i = 0; i < current_scene_choices.length; ++i) {
                                    current_scene_choices[i].classList.remove('current')
                                }
                                if ((scene_choice_cursor + 1) >= current_scene_choices.length) {
                                    scene_choice_cursor = 0
                                } else {
                                    scene_choice_cursor += 1
                                }
                                current_scene_choices[scene_choice_cursor].classList.add('current')
                            }
                        break
                        case "KeyQ":
                            wasm.exports.user_input_left_bumper()
                        break
                        case "KeyE":
                            wasm.exports.user_input_right_bumper()
                        break
                        case "KeyT":
                            wasm.exports.user_input_start()
                        break
                        case "KeyG":
                            wasm.exports.user_input_select()
                        break
                    }
                })
            }
        </script>
    </head>
    <body>
        <div id="opening_title" style="display: none; text-align: center;">
            <img src="title.png" style="width: 100%;" />

            <img src="title2.webp" style="width: 100%; padding-left: 20%; padding-right: 20%;" />
            <div>
                <div class="choice">New</div>
                <div class="choice">Load</div>
                <div class="choice">Options</div>
            </div>
        </div>

                <div class="choice">Stats</div>

                <div class="choice">Name</div>

            </div>
            <div id="scene_choices" style="display: none;"></div>
        </div>
        <div id="player_menu" style="display: none;">
            <div>Gold: <span id="gold"></span></div>
            <div>Total Items: <span id="total_items"></span></div>
        </div>
        <div id="blackjack_table" style="display: none; margin-top: 100px;">
            <div>Blackjack Table</div>
            <div id="blackjack_player_hand" style="display: grid; grid-auto-flow: column;"></div>
            <div id="blackjack_dealer_hand" style="display: grid; grid-auto-flow: column;"></div>
            <div id="blackjack_player_total"></div>
            <div id="blackjack_dealer_total"></div>

        <div id="viewport" style="display: none;"></div>
    </body>
